    "image": "https://spoonacular.com/recipeImages/716195-556x370.jpg",
    "imageType": "jpg",
    "summary": "Spicy Indian-Style Hummus might be just the hor d'oeuvre you are searching for. This recipe makes 12 servings with <b>134 calories</b>, <b>5g of protein</b>, and <b>6g of fat</b> each. For <b>43 cents per serving</b>, this recipe <b>covers 11%</b> of your daily requirements of vitamins and minerals. It is a good option if you're following a <b>gluten free and vegan</b> diet. Several people made this recipe, and 161 would say it hit the spot. If you have ground cumin, turmeric, chilies, and a few other ingredients on hand, you can make it. From preparation to the plate, this recipe takes roughly <b>45 minutes</b>. This recipe is typical of middl eastern cuisine. All things considered, we decided this recipe <b>deserves a spoonacular score of 97%</b>. This score is amazing. Try <a href=\"https://spoonacular.com/recipes/indian-style-spicy-couscous-647863\">Indian Style Spicy Couscous</a>, <a href=\"https://spoonacular.com/recipes/kashmiri-style-leg-of-lamb-this-indian-style-of-lamb-is-a-real-treat-everyone-will-think-you-are-a-gourmet-chef-600227\">Kashmiri-Style leg of lamb – this Indian style of lamb is a real treat, everyone will think you are a gourmet chef</a>, and <a href=\"https://spoonacular.com/recipes/indian-style-chicken-32222\">Indian- Style Chicken</a> for similar recipes.",
