    "imageType": "jpg",
    "summary": "You can never have too many morn meal recipes, so give Raspberry Walnut Coffee Cake a try. This recipe makes 6 servings with <b>189 calories</b>, <b>2g of protein</b>, and <b>7g of fat</b> each. For <b>93 cents per serving</b>, this recipe <b>covers 5%</b> of your daily requirements of vitamins and minerals. 63 people have tried and liked this recipe. A mixture of salt, vanilla, turbinado sugar, and a handful of other ingredients are all it takes to make this recipe so scrumptious. From preparation to the plate, this recipe takes approximately <b>35 minutes</b>. It is a good option if you're following a <b>gluten free, dairy free, and fodmap friendly</b> diet. All things considered, we decided this recipe <b>deserves a spoonacular score of 28%</b>. This score is rather bad. Try <a href=\"https://spoonacular.com/recipes/coffee-walnut-cake-221920\">Coffee & walnut cake</a>, <a href=\"https://spoonacular.com/recipes/coffee-walnut-cake-433098\">Coffee Walnut Cake</a>, and <a href=\"https://spoonacular.com/recipes/walnut-coffee-cake-464296\">Walnut Coffee Cake</a> for similar recipes.",
