    "image": "https://spoonacular.com/recipeImages/662535-556x370.jpg",
    "imageType": "jpg",
    "summary": "Sweet Mustard BBQ Pork Chops might be just the <b>American</b> recipe you are searching for. This recipe makes 4 servings with <b>445 calories</b>, <b>38g of protein</b>, and <b>16g of fat</b> each. For <b>$2.15 per serving</b>, this recipe <b>covers 23%</b> of your daily requirements of vitamins and minerals. A mixture of pork chops, coarsely ground pepper, soy sauce, and a handful of other ingredients are all it takes to make this recipe so delicious. To use up the honey you could follow this main course with the <a href=\"https://spoonacular.com/recipes/honey-gingerbread-133051\">Honey Gingerbread</a> as a dessert. 68 people were impressed by this recipe. It is a good option if you're following a <b>gluten free and dairy free</b> diet. From preparation to the plate, this recipe takes roughly <b>45 minutes</b>. It works well as an affordable main course. All things considered, we decided this recipe <b>deserves a spoonacular score of 75%</b>. This score is solid. Try <a href=\"https://spoonacular.com/recipes/sauted-pork-chops-with-sweet-potato-apples-and-mustard-sauce-185639\">Sautéed Pork Chops with Sweet Potato, Apples and Mustard Sauce</a>, <a href=\"https://spoonacular.com/recipes/pork-chops-with-mustard-17163\">Pork Chops With Mustard</a>, and <a href=\"https://spoonacular.com/recipes/mustard-pork-chops-16834\">Mustard Pork Chops</a> for similar recipes.",
