    "instructions": "<ol><li>Melt the chocolate and butter together in bain-marie and then let cool for a few minutes.</li><li>Whip eggs, egg yolks, sugar and a pinch of salt until a light yellow color. Add the melted chocolate and the flour.</li><li>Grease and flour 5 or 6 ramekins (or oven-proof glass cups) tapping out the excess flour.</li><li>Divide the chocolate cream among the ramekins</li><li>Stir in 1 tablespoon of liquor into each ramekin and stir.</li><li>Cover with plastic wrap and place in the refrigerator for about one hour or until you are ready to bake.</li><li>Pre-heat the oven to 450 F (230 C) and bake for about 13 minutes.</li><li>Remove from the oven, edges should be firm but the center will be runny.</li><li>Run a sharp knife around each cake and unmold onto serving plates. Sprinkle with powdered sugar and serve immediately.</li></ol>",
