    "image": "https://spoonacular.com/recipeImages/638088-556x370.jpg",
    "imageType": "jpg",
    "summary": "The recipe Chicken Farfalle with Low-Fat Alfredo Sauce could satisfy your Mediterranean craving in around <b>45 minutes</b>. This recipe makes 4 servings with <b>674 calories</b>, <b>43g of protein</b>, and <b>9g of fat</b> each. For <b>$1.98 per serving</b>, this recipe <b>covers 27%</b> of your daily requirements of vitamins and minerals. Only a few people made this recipe, and 7 would say it hit the spot. It works well as a main course. A mixture of juice of lemon, farfalle pasta, wine, and a handful of other ingredients are all it takes to make this recipe so scrumptious. To use up the salt you could follow this main course with the <a href=\"https://spoonacular.com/recipes/apple-turnovers-recipe-48175\">Apple Turnovers Recipe</a> as a dessert. All things considered, we decided this recipe <b>deserves a spoonacular score of 79%</b>. This score is solid. Try <a href=\"https://spoonacular.com/recipes/low-fat-cinnamon-energy-balls-909039\">Low-Fat Cinnamon Energy Balls</a>, <a href=\"https://spoonacular.com/recipes/low-carb-alfredo-sauce-with-spiralized-zucchini-909052\">Low Carb Alfredo Sauce with Spiralized Zucchini</a>, and <a href=\"https://spoonacular.com/recipes/low-carb-bagels-coconut-flour-fat-head-dough-912856\">Low Carb Bagels – Coconut Flour Fat Head Dough</a> for similar recipes.",
