    "summary": "Farfalle with fresh tomatoes, basil and mozzarella might be just the main course you are searching for. For <b>97 cents per serving</b>, this recipe <b>covers 19%</b> of your daily requirements of vitamins and minerals. This recipe makes 4 servings with <b>557 calories</b>, <b>16g of protein</b>, and <b>15g of fat</b> each. A mixture of butter, tomatoes, olive oil, and a handful of other ingredients are all it takes to make this recipe so tasty. To use up the tomatoes you could follow this main course with the <a href=\"https://spoonacular.com/recipes/pink-peony-popcorn-balls-129348\">Pink Peony Popcorn Balls</a> as a dessert. 7 people have tried and liked this recipe. It is a good option if you're following a <b>vegetarian</b> diet. From preparation to the plate, this recipe takes about <b>15 minutes</b>. All things considered, we decided this recipe <b>deserves a spoonacular score of 72%</b>. This score is good. Try <a href=\"https://spoonacular.com/recipes/tomatoes-stuffed-with-fresh-mozzarella-and-basil-153809\">Tomatoes Stuffed with Fresh Mozzarellan and Basil</a>, <a href=\"https://spoonacular.com/recipes/orecchiette-with-tomatoes-fresh-mozzarella-and-basil-200966\">Orecchiette with Tomatoes, Fresh Mozzarella, and Basil</a>, and <a href=\"https://spoonacular.com/recipes/risotto-with-fresh-mozzarella-grape-tomatoes-and-basil-215118\">Risotto with Fresh Mozzarella, Grape Tomatoes, and Basil</a> for similar recipes.",
