    "imageType": "jpg",
    "summary": "Tuna Mexi Melts might be just the main course you are searching for. One serving contains <b>700 calories</b>, <b>41g of protein</b>, and <b>40g of fat</b>. This pescatarian recipe serves 6 and costs <b>$2.7 per serving</b>. 9 people have made this recipe and would make it again. From preparation to the plate, this recipe takes roughly <b>45 minutes</b>. If you have bread, juice of lime, jalapeno, and a few other ingredients on hand, you can make it. To use up the sour cream you could follow this main course with the <a href=\"https://spoonacular.com/recipes/sour-cream-apple-pie-70374\">Sour Cream Apple Pie</a> as a dessert. All things considered, we decided this recipe <b>deserves a spoonacular score of 77%</b>. This score is good. Try <a href=\"https://spoonacular.com/recipes/homemade-mexi-melts-854873\">Homemade Mexi-Melts</a>, <a href=\"https://spoonacular.com/recipes/seared-ahi-tuna-sea-steak-over-mexi-asian-salsa-89271\">Seared Ahi Tuna Sea Steak over Mexi-Asian Salsa</a>, and <a href=\"https://spoonacular.com/recipes/tuna-melts-89365\">Tuna Melts</a> for similar recipes.",
