    "occasions": [ ],
    "instructions": "<ol><li>Instructions</li><li>Well whip up the picante first. To do this, go ahead and add all the ingredients into your food processor. Zip it up good and then add in some salt to taste.</li><li>Next up, grab your french loaf and slice it into 1 slices. Brush the melted butter over your slices of bread and then sprinkle on some cumin, chile powder, and garlic powder.</li><li>Add all the melt ingredients with the exception of the pepper jack cheese to a bowl and mix it up good. Now grab your bread and lop a large spoonful of the tuna mixture on each piece. Top them all off with a slice of pepper jack cheese. Throw your sandwiches into an oven heated to 350 degrees and let them heat up for about 10 to 15 minutes or until your cheese is melted and bubbling.</li></ol>",
