    "imageType": "jpg",
    "summary": "The recipe Honeyed Bacon\" Baklava could satisfy your middl eastern craving in about <b>about 45 minutes</b>. This recipe serves 24. One portion of this dish contains approximately <b>8g of protein</b>, <b>30g of fat</b>, and a total of <b>395 calories</b>. For <b>$1.81 per serving</b>, this recipe <b>covers 6%</b> of your daily requirements of vitamins and minerals. This recipe from Foodista requires walnuts, sugar, ground cinnamon, and bacon. 11 person have made this recipe and would make it again. Overall, this recipe earns a <b>rather bad spoonacular score of 19%</b>. <a href=\"https://spoonacular.com/recipes/bacon-baklava-393723\">Bacon Baklava</a>, <a href=\"https://spoonacular.com/recipes/honeyed-olives-238515\">Honeyed Olives</a>, and <a href=\"https://spoonacular.com/recipes/honeyed-chicken-112370\">Honeyed Chicken</a> are very similar to this recipe.",
