    "summary": "Need a <b>vegetarian dessert</b>? Blueberry Vanilla Pie could be a great recipe to try. For <b>$13.22 per serving</b>, this recipe <b>covers 56%</b> of your daily requirements of vitamins and minerals. This recipe makes 1 servings with <b>4164 calories</b>, <b>42g of protein</b>, and <b>259g of fat</b> each. Head to the store and pick up sugar, whipped cream, juice of lemon, and a few other things to make it today. A few people made this recipe, and 14 would say it hit the spot. From preparation to the plate, this recipe takes approximately <b>45 minutes</b>. All things considered, we decided this recipe <b>deserves a spoonacular score of 85%</b>. This score is great. Try <a href=\"https://spoonacular.com/recipes/blueberry-crumble-pie-920226\">Blueberry Crumble Pie</a>, <a href=\"https://spoonacular.com/recipes/blueberry-ginger-vanilla-jam-42241\">Blueberry Ginger Vanilla Jam</a>, and <a href=\"https://spoonacular.com/recipes/canning-101-and-blueberry-vanilla-jam-795010\">Canning 101 and Blueberry Vanilla Jam</a> for similar recipes.",
