    "instructions": "<ol><li>Dough:</li><li>Combine flour, sugar, salt, lemon zest and finely ground almonds.</li><li>Add the chopped butter to make the shortcrust dough.</li><li>Finally stir in the roughly chopped almonds.</li><li>Leave the dough for a short time/15minutes in the refrigerator, than roll it.</li><li>Or press it right away  into the mold and punch the dough with a fork.</li><li>Leave for 15 minutes in the freezer.</li><li>Preheat oven to maximum.</li><li>Custard:</li><li>Mix the egg with the vanilla sugar, add density and flavor of vanilla.</li><li>Half of vanilla pod put in cream and add to boil.</li><li>When boil remove the pod.</li><li>Scrape the seeds and add to the cream.</li><li>Remove cream from heat, stirring constantly and pour the egg mixture. Quite a short return to the fire that starts to thicken.</li><li>Leave aside to cool slightly.</li><li>Blueberries filling:</li><li>Half of blueberries mix with sugar, lemon juice and density.</li><li>Cook over medium heat stirring constantly, until it starts to thicken.</li><li>Set aside to cool.</li><li>Removethe mold from the freezer.</li><li>Pour the egg mixture.</li><li>Bake, pre-reducing the temperature to 200  C/392F  for 20 minutes. Remove, pour in the filling of blueberries, and bake the next 5-7 minutes.</li><li>Leave to cool.</li><li>On cooled pie arrange the remaining half of fresh blueberries.</li><li>Lightly sprinkle with granulated sugar and sliced almonds</li></ol>",
