    "summary": "Guinness and Brats is a <b>dairy free</b> beverage. This recipe serves 4 and costs $1.28 per serving. One serving contains <b>361 calories</b>, <b>14g of protein</b>, and <b>21g of fat</b>. A mixture of guinness stout beer, hotdog buns, onions, and a handful of other ingredients are all it takes to make this recipe so yummy. 86 people were impressed by this recipe. It can be enjoyed any time, but it is especially good for <b>st. patrick day</b>. From preparation to the plate, this recipe takes approximately <b>55 minutes</b>. All things considered, we decided this recipe <b>deserves a spoonacular score of 72%</b>. This score is pretty good. Similar recipes include <a href=\"https://spoonacular.com/recipes/guinness-fudge-bundt-cake-with-guinness-ganache-no-beer-goggles-needed-572705\">Guinness Fudge Bundt Cake with Guinness Ganache – No Beer Goggles Needed</a>, <a href=\"https://spoonacular.com/recipes/guinness-week-stout-and-chocolate-mousse-with-guinness-oatmeal-cookies-206974\">Guinness Week: Stout and Chocolate Mousse with Guinness Oatmeal Cookies</a>, and <a href=\"https://spoonacular.com/recipes/mile-high-guinness-brownies-with-guinness-buttercream-frosting-730287\">Mile High Guinness Brownies with Guinness Buttercream Frosting</a>.",
