    "summary": "You can never have too many Southern recipes, so give Dark Chocolate Cinnamon Easter Eggnog a try. One portion of this dish contains approximately <b>10g of protein</b>, <b>40g of fat</b>, and a total of <b>661 calories</b>. For <b>$1.4 per serving</b>, you get a beverage that serves 4. 7 people have tried and liked this recipe. <b>Christmas</b> will be even more special with this recipe. This recipe from Foodista requires egg yolks, heavy whipping cream, , and chocolate liqueur. From preparation to the plate, this recipe takes roughly <b>roughly 45 minutes</b>. It is a good option if you're following a <b>gluten free</b> diet. Overall, this recipe earns a <b>rather bad spoonacular score of 32%</b>. Similar recipes are <a href=\"https://spoonacular.com/recipes/decadent-dark-chocolate-easter-brownies-172436\">Decadent Dark Chocolate Easter Brownies</a>, <a href=\"https://spoonacular.com/recipes/dark-chocolate-chunk-eggnog-cookies-631283\">Dark Chocolate Chunk Eggnog Cookies</a>, and <a href=\"https://spoonacular.com/recipes/dark-chocolate-chunk-eggnog-cookies-508147\">Dark Chocolate Chunk Eggnog Cookies</a>.",
