    "instructions": "In a medium saucepan over medium heat, whisk together egg yolks, milk, sugar, dark chocolate, cocoa powder, and cinnamon. When mixture is well combined and just starts to boil and bubble, remove from heat.\nPour mixture in a bowl over an ice bath and whisk for several minutes until cool. Whisk in cream, liqueur, and vanilla. Serve immediately or store in refrigerator.\nTop with whipped cream and cinnamon if desired.\nMakes 4 (about 1-cup servings)\nSNAPPY TIPS: Make sure you whisk the egg yolks and liquids well while over the heat so that the eggs dont curdle.\nSNAPPY SUBSTITUTIONS: If you dont like dark chocolate you could use original unsweetened cocoa powder, and substitute your favorite chopped chocolate for the chopped dark chocolate. You can also substitute any liqueur for the chocolate liqueur.",
