    "summary": "Need a <b>vegetarian hor d'oeuvre</b>? Blue Cheese Tartlets With Fig Jam and Walnuts could be a super recipe to try. This recipe serves 24 and costs $1.01 per serving. One serving contains <b>293 calories</b>, <b>6g of protein</b>, and <b>24g of fat</b>. 8 people have made this recipe and would make it again. If you have cheese, butter, fig jam, and a few other ingredients on hand, you can make it. From preparation to the plate, this recipe takes approximately <b>45 minutes</b>. All things considered, we decided this recipe <b>deserves a spoonacular score of 37%</b>. This score is not so outstanding. Try <a href=\"https://spoonacular.com/recipes/fig-jam-flatbread-with-roasted-garlic-912421\">Fig Jam Flatbread with Roasted Garlic</a>, <a href=\"https://spoonacular.com/recipes/apple-nut-blue-cheese-tartlets-409160\">Apple-Nut Blue Cheese Tartlets</a>, and <a href=\"https://spoonacular.com/recipes/blue-cheese-apple-tartlets-175673\">Blue Cheese-Apple Tartlets</a> for similar recipes.",
