    "imageType": "jpg",
    "summary": "The recipe Corned Beef And Cabbage With Irish Mustard Sauce could satisfy your European craving in around <b>4 hours and 30 minutes</b>. This main course has <b>829 calories</b>, <b>51g of protein</b>, and <b>49g of fat</b> per serving. For <b>$5.04 per serving</b>, this recipe <b>covers 46%</b> of your daily requirements of vitamins and minerals. It can be enjoyed any time, but it is especially good for <b>st. patrick day</b>. If you have carrot, onions, cornstarch, and a few other ingredients on hand, you can make it. To use up the cornstarch you could follow this main course with the <a href=\"https://spoonacular.com/recipes/chocolate-cornstarch-pudding-604450\">Chocolate Cornstarch Pudding</a> as a dessert. A couple people made this recipe, and 27 would say it hit the spot. It is a good option if you're following a <b>gluten free</b> diet. All things considered, we decided this recipe <b>deserves a spoonacular score of 89%</b>. This score is super. Try <a href=\"https://spoonacular.com/recipes/irish-channel-corned-beef-and-cabbage-199412\">Irish Channel Corned Beef and Cabbage</a>, <a href=\"https://spoonacular.com/recipes/sheilas-famous-mustard-glazed-corned-beef-and-cabbage-94097\">Sheila's Famous Mustard-Glazed Corned Beef and Cabbage</a>, and <a href=\"https://spoonacular.com/recipes/irish-bacon-and-cabbage-with-mustard-sauce-11400\">Irish Bacon and Cabbage with Mustard Sauce</a> for similar recipes.",
