    "number": 4,
    "step": "Remove the melted chocolate from the heat and let it cool for 5 minutes.Carefully, pour the liquid chocolate ganache over each tartlet, making sure that the chocolate does not over-flow the graham crust sides. Return the tarts to the refrigerator and chill for 1 to 2 hours, or until the ganache has set. (The ganache on top should take on a smooth matte finish.)Prepare the meringue and finish the tarts: In the bowl of a standing mixer fitted with a whip attachment, whip the reserved egg whites until frothy. Slowly add the sugar, then the cream of tartar, continuing to whip until well incorporated. Increase the stand mixer to medium speed and whip until the whites are shiny and form a stiff peak. Do not over-whip or they will become grainy.",
