    "instructions": "<ol><li>Slice the onions, slit the chillies, cube the potatoes and keep aside.</li><li>Heat oil in a heavy bottomed pan or pressure cooker, splutter mustard seeds.</li><li>Add the whole spices and stir till you begin to get the aroma of the spices.</li><li>Add sliced onions,curry leaves and green chillies and saute.</li><li>Stir in the ground coriander and add the marinaded chicken. Stir so that the chicken is covered well in the sauteed mixture.</li><li>Cover and let it cook. When it is half done add the cubed potatoes.</li><li>When the chicken is almost done add the garam masala,salt and coconut milk and stir.</li><li>When done put off the heat and garnish with chopped fresh coriander.</li><li>Have I forgotten the most important ingredient? Stir it with lots of love for the family and friends who will partake of the meal.</li><li>Serve hot chicken stew with freshly made appams.</li></ol>",
