    "summary": "Brownie Coffins takes roughly <b>about 45 minutes</b> from beginning to end. One portion of this dish contains about <b>5g of protein</b>, <b>22g of fat</b>, and a total of <b>358 calories</b>. This recipe serves 5. For <b>56 cents per serving</b>, this recipe <b>covers 7%</b> of your daily requirements of vitamins and minerals. A few people really liked this American dish. 15 people were glad they tried this recipe. It works well as a dessert. If you have baking powder, sugar, chocolate cocoa powder, and a few other ingredients on hand, you can make it. It is brought to you by Foodista. Overall, this recipe earns a <b>rather bad spoonacular score of 18%</b>. Try <a href=\"https://spoonacular.com/recipes/brownie-batter-cheesecakes-with-fudge-brownie-crust-549694\">Brownie Batter Cheesecakes with Fudge Brownie Crust</a>, <a href=\"https://spoonacular.com/recipes/chewy-brownie-bites-or-brownie-cookies-484028\">Chewy Brownie Bites or Brownie Cookies</a>, and <a href=\"https://spoonacular.com/recipes/cakespy-brownie-upside-down-brownie-206751\">Cakespy: Brownie Upside-Down Brownie</a> for similar recipes.",
