    "image": "https://spoonacular.com/recipeImages/664327-556x370.jpg",
    "imageType": "jpg",
    "summary": "The recipe Vanilla Panna Cotta with Chocolate Ganache could satisfy your Mediterranean craving in roughly <b>45 minutes</b>. Watching your figure? This gluten free and primal recipe has <b>13 calories</b>, <b>1g of protein</b>, and <b>1g of fat</b> per serving. For <b>71 cents per serving</b>, this recipe <b>covers 1%</b> of your daily requirements of vitamins and minerals. This recipe is liked by 7 foodies and cooks. If you have gelatin, milk, vanilla bean, and a few other ingredients on hand, you can make it. All things considered, we decided this recipe <b>deserves a spoonacular score of 20%</b>. This score is rather bad. Try <a href=\"https://spoonacular.com/recipes/vanilla-white-chocolate-panna-cotta-with-strawberries-231138\">Vanilla White Chocolate Panna Cotta With Strawberries</a>, <a href=\"https://spoonacular.com/recipes/chocolate-panna-cotta-with-vanilla-ice-cream-and-strawberry-syrup-521014\">Chocolate panna cotta with vanillan ice cream and strawberry syrup</a>, and <a href=\"https://spoonacular.com/recipes/vanilla-panna-cotta-297498\">Vanilla Panna Cotta</a> for similar recipes.",
