    "summary": "Herbivoracious' White Bean and Kale Soup could be just the <b>gluten free</b> recipe you've been looking for. For <b>50 cents per serving</b>, you get a soup that serves 6. One serving contains <b>195 calories</b>, <b>7g of protein</b>, and <b>10g of fat</b>. 10 people have made this recipe and would make it again. It can be enjoyed any time, but it is especially good for <b>Autumn</b>. Head to the store and pick up rosemary leaves, bay leaves, carrot, and a few other things to make it today. From preparation to the plate, this recipe takes roughly <b>roughly 45 minutes</b>. It is brought to you by Foodista. With a spoonacular <b>score of 95%</b>, this dish is excellent. <a href=\"https://spoonacular.com/recipes/white-bean-kale-soup-709577\">White Bean Kale Soup</a>, <a href=\"https://spoonacular.com/recipes/white-bean-and-kale-soup-759641\">White Bean and Kale Soup</a>, and <a href=\"https://spoonacular.com/recipes/white-bean-and-kale-soup-15247\">White Bean And Kale Soup</a> are very similar to this recipe.",
