    "instructions": "<ol><li>In a medium bowl, stir together 2 cups flour and confectioners' sugar. Blend in the melted butter and vanilla essence.</li><li>Press the soft dough with the palm of your hand into the bottom of the greased 9x13 inch pan.</li><li>Bake the dough in the preheated oven at 170C for 15 minutes, or until golden.</li><li>Meanwhile, in a large bowl, beat eggs until light.</li><li>Combine the sugar, baking powder and  cup of flour so there will be no flour lumps.</li><li>Stir the sugar mixture into the eggs.</li><li>Stir in the lemon juice and lemon rind. Pour over the prepared crust and return to the oven.</li><li>Bake for an additional 30 minutes or until bars are set.</li><li>Allow to cool completely before cutting into bars.</li></ol>",
