    "summary": "Creme Brulee might be just the dessert you are searching for. This gluten free and vegetarian recipe serves 8 and costs <b>95 cents per serving</b>. One serving contains <b>167 calories</b>, <b>3g of protein</b>, and <b>14g of fat</b>. Head to the store and pick up egg, egg yolks, milk, and a few other things to make it today. 7 people have tried and liked this recipe. This recipe is typical of Mediterranean cuisine. From preparation to the plate, this recipe takes approximately <b>4 hours</b>. All things considered, we decided this recipe <b>deserves a spoonacular score of 16%</b>. This score is not so super. Similar recipes include <a href=\"https://spoonacular.com/recipes/white-chocolate-creme-brulee-with-strawberry-creme-brulee-kit-giveaway-487705\">White Chocolate Creme Brulee with Strawberry {Creme Brulee Kit Giveaway}</a>, <a href=\"https://spoonacular.com/recipes/creme-caramel-creme-brulee-pots-de-creme-572903\">Creme Caramel, Creme Brulee, Pots de Creme</a>, and <a href=\"https://spoonacular.com/recipes/crme-de-marrons-chestnut-crme-brle-253692\">Crème de Marrons Chestnut Crème Brûlée</a>.",
