    "summary": "Farro & Leek Soup takes around <b>approximately 45 minutes</b> from beginning to end. One portion of this dish contains around <b>50g of protein</b>, <b>12g of fat</b>, and a total of <b>661 calories</b>. This recipe serves 4 and costs $6.61 per serving. A mixture of celery, carrot, onion, and a handful of other ingredients are all it takes to make this recipe so tasty. It works well as a pricey main course for <b>Autumn</b>. 8 people were impressed by this recipe. It is brought to you by Foodista. With a spoonacular <b>score of 87%</b>, this dish is excellent. Users who liked this recipe also liked <a href=\"https://spoonacular.com/recipes/farro-leek-soup-39109\">Farro & Leek Soup</a>, <a href=\"https://spoonacular.com/recipes/zuppa-di-farro-italian-farro-soup-628098\">Zuppa di Farro (Italian Farro Soup)</a>, and <a href=\"https://spoonacular.com/recipes/sweet-corn-gouda-and-farro-risotto-plus-15-more-farro-s-youll-love-forever-617100\">Sweet Corn, Goudan and Farro Risotto Plus 15 More Farro s You’ll Love Forever</a>.",
