    "instructions": "<ol><li>Preheat the oven to 350 degrees F. Line a cupcake or muffin pan with 24 regular-size cupcake liners.</li><li>Combine the chocolate chips and hot coffee together, stirring occasionally until the chocolate is melted and the mixture is smooth. In a large bowl sift together the sugar, flour, cocoa powder, baking soda, baking powder and salt. In another bowl, beat the eggs with an electric mixer until thickened slightly. Slowly add the buttermilk, oil and vanilla. Add the melted chocolate mixture to the eggs, and combine completely. Add the sugar mixture and beat on medium speed until well combined.</li><li>Fill the prepared cupcake liners three-quarters full with the cupcake batter. Place in the oven and bake until a toothpick inserted in center comes out clean, 18 to 21 minutes. Cool the cupcakes completely.</li><li>While the cupcakes are baking, prepare the Chocolate Ganache and the Peppermint Marshmallow Buttercream Frosting (directions for both below). Put the frosting into a pastry bag fitted with a star tip.</li><li>To make the Chocolate Ganache, bring the heavy cream and butter to a simmer in a small saucepan. Turn off the heat and add in the chocolate. Stir the mixture until smooth. Set aside to cool.</li><li>To make the Peppermint Marshmallow Buttercream Frosting, whip together the butter and marshmallow cream, using an electric mixer fitted with a whisk attachment. Add the peppermint extract. Slowly add 2 cups of the powdered sugar and continue to mix on a slow speed. Add the milk and additional powdered sugar, up to 2 cups, until desired consistency is reached.</li><li>To assemble cupcakes:</li><li>Using an apple corer, remove the center of each cupcake. Fill each cupcake with a spoonful of the Chocolate Ganache. Using the frosting-filled pastry bag, frost the cupcakes and sprinkle with crushed peppermint candies.</li></ol>",
