    "id": 664025,
    "title": "Turkey Enchilada Bake",
    "readyInMinutes": 45,
    "servings": 8,
    "sourceUrl": "http://www.foodista.com/recipe/KX5B3NYB/turkey-enchilada-bake",
    "summary": "The recipe Turkey Enchilada Bake is ready <b>in around 45 minutes</b> and is definitely an amazing <b>gluten free</b> option for lovers of Mexican food. This recipe makes 8 servings with <b>507 calories</b>, <b>25g of protein</b>, and <b>31g of fat</b> each. For <b>$3.01 per serving</b>, this recipe <b>covers 25%</b> of your daily requirements of vitamins and minerals. This recipe is liked by 31 foodies and cooks. It works well as a rather pricey main course. A mixture of salsa, garlic, corn tortillas, and a handful of other ingredients are all it takes to make this recipe so delicious. To use up the onion you could follow this main course with the <a href=\"https://spoonacular.com/recipes/candy-corn-cupcakes-63881\">Candy Corn Cupcakes</a> as a dessert. All things considered, we decided this recipe <b>deserves a spoonacular score of 82%</b>. This score is outstanding. Try <a href=\"https://spoonacular.com/recipes/roasted-turkey-enchilada-bake-422626\">Roasted Turkey Enchilada Bake</a>, <a href=\"https://spoonacular.com/recipes/roasted-turkey-enchilada-bake-268214\">Roasted Turkey Enchilada Bake</a>, and <a href=\"https://spoonacular.com/recipes/turkey-enchilada-pasta-bake-sundaysupper-620557\">Turkey Enchilada Pasta Bake #SundaySupper</a> for similar recipes.",
    "cuisines": [
    "Mexican"
    ],
    "dishTypes": [
    "lunch",
    "main course",
    "main dish",
    "dinner"
    ],
    "diets": [
    "gluten free"
    ],
    "occasions": [ ],
    "instructions": "<ol><li>1.Make the turkey mixture: Roast the vegetables: Preheat oven to 400 degrees.Cut the tomatillos in half, slice the onion into  in slices and remove garlic from covering. Place on baking sheet. Roast till tomatillos are tender and start to brown, about 20 minutes.</li><li>2.Meanwhile,make the sauce: Add tomatillos, onion, garlic, tomatoes, green chilies, chipotles, chili powder, cumin, paprika, and coriander to blender or food processor. Blend until smooth.</li><li>In a large bowel, add the turkey, beans, and sauce, Mix together until everything is evenly distributed.</li><li>3.Layer 1:In a 9 by 13 baking dish, spread salsa on the bottom evenly. place 3.5 tortillas on top, making sure they cover evenly. Add 1 cup of turkey mixture on top of tortillas, spreading evenly. Add 1 cup of cheese on top, sprinkling evenly. Place  cup of thinly sliced red onion on top of cheese.</li><li>4.Layer 2: Repeat of layer 1</li><li>5.Layer 3:Place tortillas, then turkey. Place the sliced of avocado on top of turkey so they evenly cover. Add lime juice evenly over avocado, this will help them stay green. Top with final cup of cheese. Cover with foil.</li><li>6.Place in oven and bake for 30 min, rotating  way. Remove foil and chook for another 10 minutes.</li><li>7.Let cool for at least 10 minutes. Serve with chopped cilantro and a dollop of sour cream. Serve with tortillas chips. Enjoy!</li><li>Your can find step by step pictures on how to make the turkey mixture on my Mini Mexican Bell Pepper Recipe</li><li>Again, I made a double batch of turkey when I made those, so this recipe was even easier. I highly recommend doing so.</li></ol>",
