    "summary": "You can never have too many main course recipes, so give Pork with Blueberry Sauce a try. For <b>$3.22 per serving</b>, this recipe <b>covers 21%</b> of your daily requirements of vitamins and minerals. One serving contains <b>312 calories</b>, <b>29g of protein</b>, and <b>13g of fat</b>. 9 people have made this recipe and would make it again. Head to the store and pick up balsamic vinegar, canolan oil, pepper, and a few other things to make it today. To use up the lime zest you could follow this main course with the <a href=\"https://spoonacular.com/recipes/orange-marmalade-cookies-with-orange-zest-icing-589746\">Orange Marmalade Cookies with Orange Zest Icing</a> as a dessert. It is a good option if you're following a <b>gluten free and dairy free</b> diet. From preparation to the plate, this recipe takes approximately <b>45 minutes</b>. All things considered, we decided this recipe <b>deserves a spoonacular score of 71%</b>. This score is pretty good. Try <a href=\"https://spoonacular.com/recipes/pork-with-blueberry-herb-sauce-411544\">Pork with Blueberry Herb Sauce</a>, <a href=\"https://spoonacular.com/recipes/pork-tenderloin-w-blueberry-barbecue-sauce-517957\">Pork Tenderloin w/ Blueberry Barbecue Sauce</a>, and <a href=\"https://spoonacular.com/recipes/rosemary-sage-garlic-pork-tenderloin-with-wild-blueberry-sauce-559085\">Rosemary-Sage & Garlic Pork Tenderloin with Wild Blueberry Sauce</a> for similar recipes.",
