    "imageType": "jpg",
    "summary": "Need a <b>vegan main course</b>? Citrusy Pecan Garbanzo Couscous: A Salad For Cold Weather could be an excellent recipe to try. This recipe serves 2 and costs $2.75 per serving. One serving contains <b>564 calories</b>, <b>15g of protein</b>, and <b>17g of fat</b>. A couple people made this recipe, and 41 would say it hit the spot. Head to the store and pick up rice vinegar, ground cumin, olive oil, and a few other things to make it today. To use up the pecans you could follow this main course with the <a href=\"https://spoonacular.com/recipes/bourbon-cake-with-pecans-a-southern-classic-828483\">Bourbon Cake with Pecans: A Southern Classic</a> as a dessert. From preparation to the plate, this recipe takes around <b>45 minutes</b>. All things considered, we decided this recipe <b>deserves a spoonacular score of 97%</b>. This score is tremendous. Try <a href=\"https://spoonacular.com/recipes/winter-fruit-salad-cool-food-for-cold-weather-580660\">Winter Fruit Salad: Cool Food for Cold Weather</a>, <a href=\"https://spoonacular.com/recipes/citrusy-couscous-salad-with-olives-698723\">Citrusy Couscous Salad with Olives</a>, and <a href=\"https://spoonacular.com/recipes/cold-weather-venison-chili-506759\">Cold-Weather Venison Chili</a> for similar recipes.",
